import React from 'react';
import {
	Grid,
	GridItem,
	Box,
	Center
} from '@chakra-ui/react';

const MainPage = () => {
	return (
		<Center>
			<Grid templateColumns='repeat(10, 1fr)' gap={3} h='200px'>
				<GridItem colSpan={3} bg='tomato'></GridItem>
			</Grid>
		</Center>
	)
}

export default MainPage;
